    TestValue('ZZZZ', 'Childhood M. by DRAX', ' CHILDHOOD MEMORIES', '  partly converted and', '   partly composed by', '    Thomas Mogensen', ' (orig.: Carl Nielsen)', '             2000', '    MANIACS of NOISE', 'This module is almost', 'a complete conversion', 'of the title melody of', 'a danish serie called', '"Min fynske Barndom".', "It's originally compo-", 'sed by a famous danish', 'classical composer', 'called Carl Nielsen...', 'This conversion, how-', "ever isn't 100% cor-", "rect since I didn't", 'have the original song', 'This is converted di-', 'rectly from my memory', '... The original song', "didn't have strings as", "I remember it. That's", "something that I've", 'added (the original', 'was for harpe and', 'flute, I think)...', "Futhermore I've added", 'a little part which I', 'have composed all by', 'myself...', 'Why did I choose to', 'do this song?', 'Simply because I think', "it's brilliant!!!", "It's both simple and", 'complex at the same', 'time.', 'The melody line itself', 'is pretty catching and', 'quite simple the', 'chords are simple but', 'the way those chords', 'shift among different', 'kinds of mood is simp-', 'ly outstanding!!!', '     Greetings go to:', '       Jeroen G. Tel', '  Thomas E. Petersen', '       Ole Mogensen', '     Anders Daugaard', '  Jens-Christian Huus', '    Poul-Jesper Olsen', '    Torben K. Hansen', '  Morten S. Kristensen', 'Joergen Trolle Oerberg', "  Soeren 'JEFF' Lund", ' Soeren Raadvad Lund', '  Thomas Christiansen', '         MAZEDUDE', '              VIRT', '         Carl .borg', '    Tom Roger Skauen', ' Tor Bernhard Gausen', '       Thomas Bendt', '         David Halmi', '  LOLOLOLO (Laurent)', ' #c-64 and #trax (IRC)', "and all the guys I've", 'forgotten!!!', '  Finished: 25.08.2000', '            signed,', '    Thomas Mogensen', '              2000', '    MANIACS of NOISE'),
